import Header from "./Header";
import React from "react";
import * as S from "./style";
import TodoList from "../components/TodoList";
import NewInput from "../components/NewInput";
const Layout: React.FC = () => {
  return (
    <>
      <Header />
      <S.BodyWrapper>
        <TodoList />
        <NewInput />
      </S.BodyWrapper>
    </>
  );
};
export default Layout;
